Sara is Evan's new neighbor and apparently they've been getting their mail delivered to each others' homes since they've got the same last name. While their talking, Evan asks why Sara and her husband haven't attended any of his parties he's invited them, too. When Sara explains that her hubby is out of town on business a lot, Evan tells her she can count on him for any emergency, any time. Sara decides right then that there's an emergency in her loins, and it needs immediate urgent attention from Evan's big cock, and he can't help but be neighborly to her.
